Serialization and deserialization of a message works by consecutively iterating through the fields in the order they were listed in the message specification, and encoding the value as defined by the type. Fields with the NOXFER attribute will be skipped. Example The message <MSG_PERSON> <RECORD> <Name TYPE="STR">Edgar Allan Poe</Name> <Age TYPE="UBYT">40</Age> </RECORD>
</MSG_PERSON> serializes to [ # String length prefix (15) 0x0f, 0x00, # String bytes without null terminator (Edgar Allan Poe) 0x45, 0x64, 0x67, 0x61, 0x72, 0x20, 0x41, 0x6c, 0x6c, 0x61, 0x6e, 0x20, 0x50, 0x6f, 0x65, # Age byte (40) 0x28
]

