REC1 is a field in the aforementioned MSG_USER_AUTHEN_V3 data message that holds a record of the user's credentials. The actual data there is encrypted with Twofish in OFB mode. The logic used to derive Twofish keys and IVs for this operation is: func generateIV() []byte { const ivConstant = 0xB6 iv := make([]byte, 16) for i := 0; i < len(iv); i++ { iv[i] = ivConstant - byte(i) } return iv
} func generateKey(sid uint16, timeSecs uint32, timeMillis uint32) []byte { const keyConstant = 0x17 key := make([]byte, 32) for i := 0; i < len(key); i++ { key[i] = keyConstant + byte(i) } le := make([]byte, 4) binary.LittleEndian.PutUint16(le, sid) key[4] = le[0] key[5] = le[2] // This is always zero key[6] = le[1] binary.LittleEndian.PutUint32(le, timeSecs) key[8] = le[0] key[9] = le[2] key[12] = le[1] key[13] = le[3] binary.LittleEndian.PutUint32(le, timeMillis) key[14] = le[0] key[15] = le[1] return key
} With this at hand, the actual Record can be built and encrypted: func buildRecord1(username string, ck1 string, sid uint16, timeSecs uint32, timeMillis uint32) []byte { key := generateKey(sid, timeSecs, timeMillis) iv := generateIV() // Prepare the Twofish OFB context for later encryption block, _ := twofish.NewCipher(key) stream := cipher.NewOFB(block, iv) // Build the plaintext Record we would like to send record := fmt.Sprintf("%v %v %v", sid, username, ck1) // Encrypt and return the record stream.XORKeyStream(record, record) return record
} Servers will need to decrypt the received record, split the plaintext at whitespace and parse it as Session ID, Username, ClientKey1 which can be accordingly validated by deriving the CK1 for the password hash stored along with the username.
